import React, { Component } from 'react';

class SearchInput extends Component {
  render() {
    return (
      <div>
        <input type="text" />
      </div>
    )
  }
}

class ListProducts extends Component {
  render() {
    return(
      <div>
        <SearchInput />
      </div>
    );
  }
}

export default ListProducts;
